import PropTypes from "prop-types";
import styles from "./GroupComponent2.css";

const GroupComponent2 = ({ className = "" }) => {
  return (
    <div className={[styles.rectangleParent, className].join(" ")}>
      <div className={styles.frameChild} />
      <div className={styles.testimonialAuthor}>
        <h3 className={styles.loremIpsumDolor}>Lorem Ipsum Dolor Sit</h3>
        <div className={styles.quoteMarks}>
          <img className={styles.icon} loading="lazy" alt="" src="/.svg" />
          <div className={styles.discoverComprehensiveHealth}>
            Discover comprehensive health care support services conveniently
            tailored to meet all your needs in one place. Discover comprehensive
            health care support services conveniently tailored to meet all your
            needs in one place.
          </div>
        </div>
      </div>
      <div className={styles.authorDetails}>
        <b className={styles.lalitSomya}>Lalit Somya</b>
        <div className={styles.heartPatient}>Heart Patient</div>
      </div>
    </div>
  );
};

GroupComponent2.propTypes = {
  className: PropTypes.string,
};

export default GroupComponent2;
